tables.table_schema:
CREATE TABLE voter_turnout (
    voter_id INT PRIMARY KEY,
    name VARCHAR(50),
    age INT,
    registration_date DATE
);

CREATE TABLE voter_demographics (
    voter_id INT PRIMARY KEY,
    gender VARCHAR(10),
    ethnicity VARCHAR(50),
    occupation VARCHAR(50)
);

CREATE TABLE voter_analysis (
    analysis_id INT PRIMARY KEY,
    voter_id INT,
    turnout_status VARCHAR(10),
    analysis_date DATE
);
